import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import PRODUCT_TABLE from '../Data/ProductTable';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

const rows = PRODUCT_TABLE;

export default function SimpleTable() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>S.no</TableCell>
            <TableCell>Description</TableCell>
            <TableCell>British Standard</TableCell>
            <TableCell>American Standard</TableCell>
            </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.count}
              </TableCell>
              <TableCell>{row.description}</TableCell>
              <TableCell>{row.brit}<br/>{row.brit2}</TableCell>
              <TableCell>{row.america}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
